import React from "react";
import farm from '../../imgs/farm.jpg'
import './home.css';
import {Info} from '../../components/info/Info';
const Home = () => {
    return(
        <div className="home">
            <div className="landing">
            <h1 style={{margin:0}}>
                <img src={farm} alt="" />
            </h1>
            <div className="landing__text">
                <h1>The Green Garden Network</h1>
                <p>Uniting communities, promoting sustainability, and sharing the joy of urban green spaces.</p>
            </div>
            </div>
            <div className="about">
                <h1>About</h1>
                <Info title='Accessibility' desc="In the midst of urban New York City, certain areas grapple with the challenge of limited access to affordable and nutritious food. GreenGardenNetwork recognizes this disparity and aims to bridge the gap through the transformative power of community gardens."/>
                <Info title='Community' desc="For the youth seeking meaningful volunteer opportunities, community gardens stand as a beacon. By actively participating in these gardens, they not only learn the intricacies of crop cultivation but also develop a profound respect for the dedication and effort involved. Becoming part of a new community, volunteers gain not only practical knowledge about food production but also a sense of connection and shared purpose."/>
                <Info title='Impact' desc="Our mission at GreenGardenNetwork is rooted in fostering a sense of community, education, and empowerment through the promotion of community gardens. We serve as a centralized hub, providing a comprehensive database for individuals searching for nearby community gardens and related events. Join us in cultivating not just gardens but vibrant communities, empowering individuals to make informed choices and contributing to a healthier, more connected urban landscape."/>
            </div>
        </div>
    )
}
export {Home}
